var blink		= '<img src="data:image/gif;base64," border="0" />';
var tounge		= '<img src="data:image/gif;base64," border="0" />';
var smile		= '<img src="data:image/gif;base64," border="0" />';
var confused	= '<img src="data:image/gif;base64," border="0" />';
var sad			= '<img src="data:image/gif;base64," border="0" />';
var shocking	= '<img src="data:image/gif;base64," border="0" />';
var wink		= '<img src="data:image/gif;base64," border="0" />';
var lol     = '<img src="data:image/gif;base64,R0lGODlhEwARAKIAAAAAAP///9TU1AQEBAMDAwICAgEBAf///yH5BAEAAAcALAAAAAATABEAAANJeLrc/jBKBqq9eIHAu//AsQWFZxjjGAgVp5ZuoLJpBweG3NHcfeezlqyQwxFdLZZIwGyumtCQAlMSEAaFS2QjMEw0la94TBYnAAA7" border="0" />'
var lmao  = '<img src="data:image/gif;base64," border="0">'
var cry  = '<img src="data:image/gif;base64,%3D" border="0">'
var lurk  = '<img src="data:image/gif;base64,%3D" border="0">'
var dizzy  = '<img src="data:image/gif;base64," border="0">'
//var lmao  = '<img src="" border="0">'


// **********************************************************************************************************************************************
// CHANGING icons
// **********************************************************************************************************************************************
window.addEventListener(
	'load',
	function() { 
	
	var emotestxt 	= document.getElementsByTagName('table');

	var EMOTES 		= new Array(":)",":o)",":0)","=)","=o)","=0)",":]"
								,":S",":oS",":0S","=S","=oS","=0S",":-s"
								,":(",":o(",":0(","=(","=o(","=0("
								,":D",":oD",":0D","=D","=oD","=0D"
								,":|",":o|",":0|","=|","=o|","=0|","8-|"
								,":P",":oP",":0P","=P","=oP","=0P"
								,"O_O","O__O"
								,"lol","LOL"
								,":'(","!_!"
								,"_"
								,"lmao","LMAO"
								,"@_@","@ _ @"
								,";)",";o)",";0)"
								);
	var EMOTESIMG 	= new Array(smile,smile,smile,smile,smile,smile,smile
								,confused,confused,confused,confused,confused,confused,confused
								,sad,sad,sad,sad,sad,sad
								,briggin,briggin,briggin,briggin,briggin,briggin
								,blink,blink,blink,blink,blink,blink,blink
								,tounge,tounge,tounge,tounge,tounge,tounge
								,shocking,shocking
								,lol,lol
								,cry,cry
								,lurk
								,lmao,lmao
								,dizzy,dizzy
								,wink,wink,wink
								);
		
		text = emotestxt.item(0).innerHTML;

		for(e=0;e<EMOTES.length;e++){
		var intIndexOfMatch = text.indexOf(EMOTES[e]);
		while (intIndexOfMatch != -1){
			text = text.replace( EMOTES[e], EMOTESIMG[e]);
			intIndexOfMatch = text.indexOf( EMOTES[e] );
		}
	}
  
      emotestxt.item(0).innerHTML =  text;
	},
	true);